import React from "react";
import ReactDOM from "react-dom";

const Login =() => {
    const heading = "Welcome to Login Page";
    return (
        <div classname = "Login_Layout">
            <h1> <b> Welcome to Login Page  </b></h1>
            <h1> Enter Your Credentials </h1>
            <form>
                 <label> <h2> Company Id </h2>
                <br/>
                   <input type="numbers" id="company_id" name="company_id"/>
                </label>
                <br/>
                <label> <h2> Password </h2>
                <br/>
                    <input type="password" id="password" name="password"/>
                </label>
            </form>
        </div>
    );
    const Button = () => {
        alert("Great Job");
    return (
        <button onClick ={Button}>Login</button>
    );
    }
}
    
    
export default Login;
